import React from "react";
import {AppBar, Toolbar, styled } from "@mui/material";

const Header= styled(AppBar)`
height :200px;
background-color: #00bfa5;
`

const LoginDialog = () => {
  return (<div>
    <Header>
        <Toolbar>
        Hello from login
        </Toolbar>
    </Header>
    </div>
  );
};

export default LoginDialog;
